import React from "react";
import "./popup.css";

function POPUP({ elementsMap, stateValue, ...otherProps }) {
  const { popup, setPopup } = stateValue;
  console.log(elementsMap);

  const handleEventClick = () => {
    setPopup(false);
  };

  return (
    <div>
      {elementsMap.length>0 ? (
        <table>
          <tbody>
            <tr>
              {Object.keys(elementsMap[0]).map((element) => {
                return <th key={element}>{element}</th>;
              })}
            </tr>
            {elementsMap.map((val, key) => {
              return (
                <tr key={key}>
                  {Object.values(val).map((value) => {
                    return <td key={Math.random()}>{value}</td>;
                  })}
                </tr>
              );
            })}
          </tbody>
        </table>
      ) : (
        ""
      )}
    </div>
  );
}

export default POPUP;
